description:
A romantic storu inspired be the raw passion and sex appeal of the tango! Andy San Dimas has the world at her feet until she meets a tall, dark stranger. Captivated by Marco RIvera's exotic accent, charming wit and chiseled body, Andy feels the pattion of the dance pulling them closer no matter how hard seh resists. Then a shocking betrayal sends Andy racing into his arms where they discover the final secret to the tango together.

